"use strict";(self.webpackChunkspanish_app=self.webpackChunkspanish_app||[]).push([[998],{5998:e=>{e.exports=JSON.parse('{"2":{"words":[{"spanish":"Yo","english":"I"},{"spanish":"T\xfa","english":"You"},{"spanish":"\xc9l","english":"He"},{"spanish":"Ella","english":"She"},{"spanish":"Usted","english":"You"},{"spanish":"Yo hablo","english":"I speak"},{"spanish":"T\xfa hablas","english":"You speak"},{"spanish":"\xc9l habla","english":"He speaks"},{"spanish":"Yo como","english":"I eat"},{"spanish":"T\xfa comes","english":"You eat"},{"spanish":"Ella come","english":"She eats"},{"spanish":"Yo vivo","english":"I live"},{"spanish":"T\xfa vives","english":"You live"},{"spanish":"\xc9l vive","english":"He lives"},{"spanish":"Yo soy","english":"I am"},{"spanish":"T\xfa eres","english":"You are"},{"spanish":"Ella es","english":"She is"},{"spanish":"Yo estoy","english":"I am (location/feeling)"},{"spanish":"T\xfa est\xe1s","english":"You are (location/feeling)"},{"spanish":"\xc9l est\xe1","english":"He is (location/feeling)"},{"spanish":"Yo tengo","english":"I have"},{"spanish":"T\xfa tienes","english":"You have"},{"spanish":"\xc9l tiene","english":"He has"},{"spanish":"Yo voy","english":"I go"},{"spanish":"T\xfa vas","english":"You go"},{"spanish":"Ella va","english":"She goes"},{"spanish":"Yo trabajo","english":"I work"},{"spanish":"T\xfa trabajas","english":"You work"},{"spanish":"\xc9l trabaja","english":"He works"}],"conversations":[{"id":1,"topic":"Hablando del trabajo","dialog":[{"speaker":"Sof\xeda","spanish":"\xbfEn qu\xe9 trabajas, Juan?","english":"What do you work as, Juan?"},{"speaker":"Juan","spanish":"Yo trabajo en un restaurante. Soy mesero.","english":"I work in a restaurant. I am a waiter."},{"speaker":"Sof\xeda","spanish":"\xa1Qu\xe9 bien! Y tu hermano, \xbfen qu\xe9 trabaja?","english":"How nice! And your brother, what does he work as?"},{"speaker":"Juan","spanish":"\xc9l es estudiante en la universidad. Por la tarde, \xe9l trabaja en una tienda.","english":"He is a student at the university. In the afternoon, he works in a store."},{"speaker":"Sof\xeda","spanish":"Ah, yo tambi\xe9n soy estudiante. Voy a la misma universidad.","english":"Oh, I am also a student. I go to the same university."},{"speaker":"Juan","spanish":"Qu\xe9 coincidencia! \xbfY qu\xe9 estudias?","english":"What a coincidence! And what do you study?"}],"questions":[{"question":"\xbfEn qu\xe9 trabaja Juan?","options":["Es mesero","Es estudiante","Trabaja en una tienda","No trabaja"],"answer":"Es mesero","answerIndex":0},{"question":"\xbfQu\xe9 hace el hermano de Juan?","options":["Es mesero","Trabaja en un banco","Es estudiante","Habla mucho"],"answer":"Es estudiante","answerIndex":2},{"question":"\xbfQu\xe9 significa \'Yo trabajo en un restaurante\'?","options":["I eat in a restaurant","I live in a restaurant","I work in a restaurant","I am a restaurant"],"answer":"I work in a restaurant","answerIndex":2}]},{"id":2,"topic":"Preguntando por un amigo","dialog":[{"speaker":"Pedro","spanish":"\xbfD\xf3nde vive tu amigo David?","english":"Where does your friend David live?"},{"speaker":"Laura","spanish":"\xc9l vive en la ciudad, en un apartamento peque\xf1o. Est\xe1 cerca de la biblioteca.","english":"He lives in the city, in a small apartment. It\'s close to the library."},{"speaker":"Pedro","spanish":"\xbfY t\xfa, d\xf3nde vives? \xbfVives en un apartamento tambi\xe9n?","english":"And you, where do you live? Do you live in an apartment too?"},{"speaker":"Laura","spanish":"No, yo vivo en las afueras, en una casa grande con mi familia.","english":"No, I live in the suburbs, in a big house with my family."},{"speaker":"Pedro","spanish":"Yo vivo en la misma calle que David. Mi casa est\xe1 al lado de su apartamento.","english":"I live on the same street as David. My house is next to his apartment."},{"speaker":"Laura","spanish":"\xa1Eso es muy conveniente! Pueden ir al trabajo juntos.","english":"That\'s very convenient! You can go to work together."}],"questions":[{"question":"\xbfD\xf3nde vive el amigo de Laura?","options":["En una casa grande","En la misma calle","En la ciudad","En las afueras"],"answer":"En la ciudad","answerIndex":2},{"question":"\xbfD\xf3nde vive Laura?","options":["En un apartamento peque\xf1o","En la ciudad","En una casa grande","En la misma calle"],"answer":"En una casa grande","answerIndex":2},{"question":"\xbfQu\xe9 significa \'\xc9l vive en la ciudad\'?","options":["I live in the city","He lives in the city","You live in the city","She lives in the city"],"answer":"He lives in the city","answerIndex":1}]},{"id":3,"topic":"Hablando de posesiones","dialog":[{"speaker":"Marcos","spanish":"Tengo un perro grande y dos gatos peque\xf1os. Mis mascotas comen mucho.","english":"I have one big dog and two small cats. My pets eat a lot."},{"speaker":"Elena","spanish":"\xa1Qu\xe9 bien! \xbfY t\xfa tienes mascotas, Marcos?","english":"How nice! And do you have pets, Marcos?"},{"speaker":"Marcos","spanish":"No, yo no tengo mascotas. Pero mi hermana tiene un p\xe1jaro. \xc9l es muy ruidoso.","english":"No, I don\'t have pets. But my sister has a bird. He is very loud."},{"speaker":"Elena","spanish":"Mi hermano tambi\xe9n tiene un p\xe1jaro. Es de color verde y \xe9l siempre canta. Es muy simp\xe1tico.","english":"My brother also has a bird. It is green and he always sings. He is very nice."},{"speaker":"Marcos","spanish":"Qu\xe9 divertido! Mi hermana y su p\xe1jaro son felices en su casa.","english":"How fun! My sister and her bird are happy in their house."},{"speaker":"Elena","spanish":"Tengo que irme. Mi gato me espera para comer.","english":"I have to go. My cat is waiting for me to eat."}],"questions":[{"question":"\xbfCu\xe1ntos perros tiene Marcos?","options":["Uno","Dos","Tres","Ninguno"],"answer":"Uno","answerIndex":0},{"question":"\xbfQu\xe9 tiene la hermana de Marcos?","options":["Un perro","Dos gatos","Un p\xe1jaro","Una casa"],"answer":"Un p\xe1jaro","answerIndex":2},{"question":"\xbfQu\xe9 significa \'Yo tengo un perro\'?","options":["You have a dog","I have a cat","He has a dog","I have a dog"],"answer":"I have a dog","answerIndex":3}]},{"id":4,"topic":"Usando ser y estar","dialog":[{"speaker":"Daniel","spanish":"\xa1Hola, Ana! \xbfC\xf3mo est\xe1s? \xbfEst\xe1s en la universidad?","english":"Hello, Ana! How are you? Are you at the university?"},{"speaker":"Ana","spanish":"Hola, Daniel. Estoy muy bien, gracias. Y t\xfa, \xbfc\xf3mo est\xe1s? S\xed, yo estoy en la universidad ahora.","english":"Hello, Daniel. I am very well, thank you. And you, how are you? Yes, I am at the university now."},{"speaker":"Daniel","spanish":"Yo estoy cansado porque la clase de hoy es muy dif\xedcil para m\xed.","english":"I am tired because today\'s class is very difficult for me."},{"speaker":"Ana","spanish":"S\xed, es una clase dif\xedcil. La profesora es muy inteligente. Yo soy una estudiante de espa\xf1ol.","english":"Yes, it is a difficult class. The teacher is very intelligent. I am a Spanish student."},{"speaker":"Daniel","spanish":"Yo tambi\xe9n soy estudiante de espa\xf1ol. Somos de la misma clase.","english":"I am a Spanish student too. We are in the same class."},{"speaker":"Ana","spanish":"\xa1Qu\xe9 bien! Ma\xf1ana, la clase es m\xe1s f\xe1cil.","english":"How nice! Tomorrow, the class is easier."}],"questions":[{"question":"\xbfC\xf3mo se siente Daniel?","options":["Feliz","Triste","Cansado","Bien"],"answer":"Cansado","answerIndex":2},{"question":"\xbfQu\xe9 significa \'La clase de hoy es dif\xedcil\'?","options":["The class is easy","The class is fun","The class is difficult","The class is short"],"answer":"The class is difficult","answerIndex":2},{"question":"\xbfQu\xe9 significa \'Yo soy un estudiante\'?","options":["I am a student","You are a student","He is a student","She is a student"],"answer":"I am a student","answerIndex":0}]},{"id":5,"topic":"Hablando de planes","dialog":[{"speaker":"Fernando","spanish":"\xbfA d\xf3nde vas, Luc\xeda? \xbfVas al gimnasio?","english":"Where are you going, Luc\xeda? Are you going to the gym?"},{"speaker":"Luc\xeda","spanish":"S\xed, yo voy al gimnasio para hacer ejercicio. Yo voy todos los d\xedas.","english":"Yes, I am going to the gym to exercise. I go every day."},{"speaker":"Fernando","spanish":"\xbfA d\xf3nde va tu amiga ahora?","english":"Where is your friend going now?"},{"speaker":"Luc\xeda","spanish":"Ella va a la biblioteca a estudiar para su clase. Ella estudia mucho porque tiene un examen.","english":"She is going to the library to study for her class. She studies a lot because she has an exam."},{"speaker":"Fernando","spanish":"Yo voy al trabajo ahora. Mi trabajo est\xe1 muy lejos de aqu\xed. \xa1Adi\xf3s!","english":"I am going to work now. My job is very far from here. Goodbye!"},{"speaker":"Luc\xeda","spanish":"Adi\xf3s, Fernando. \xa1Divi\xe9rtete en tu trabajo!","english":"Goodbye, Fernando. Have fun at your job!"}],"questions":[{"question":"\xbfA d\xf3nde va Luc\xeda?","options":["A la biblioteca","Al gimnasio","Al trabajo","Al cine"],"answer":"Al gimnasio","answerIndex":1},{"question":"\xbfQu\xe9 hace la amiga de Luc\xeda?","options":["Va al gimnasio","Estudia","Trabaja","Come"],"answer":"Estudia","answerIndex":1},{"question":"\xbfQu\xe9 significa \'Yo voy al trabajo ahora\'?","options":["He goes to work now","You go to work now","She goes to work now","I go to work now"],"answer":"I go to work now","answerIndex":3}]}],"stories":[{"id":1,"title":"Mi D\xeda Ocupado","sentences":[{"spanish":"Soy un estudiante y vivo en un apartamento peque\xf1o. Mi apartamento est\xe1 cerca de la universidad.","english":"I\'m a student and I live in a small apartment. My apartment is close to the university."},{"spanish":"Por la ma\xf1ana, yo voy a la universidad en autob\xfas. Mi clase de espa\xf1ol es a las nueve. Es una clase muy interesante.","english":"In the morning, I go to the university by bus. My Spanish class is at nine. It is a very interesting class."},{"spanish":"En la universidad, hablo con mis amigos y estudio mucho. Despu\xe9s, yo como el almuerzo a la una. Hoy yo como una hamburguesa con papas fritas.","english":"At the university, I talk with my friends and I study a lot. After, I eat lunch at one. Today I am eating a hamburger with fries."},{"spanish":"Yo estoy cansado porque tengo un examen importante ma\xf1ana. El examen es dif\xedcil, pero yo estoy preparado.","english":"I am tired because I have an important exam tomorrow. The exam is difficult, but I am prepared."},{"spanish":"Por la tarde, yo voy a mi trabajo. Yo soy mesero en un restaurante italiano.","english":"In the afternoon, I go to my job. I am a waiter at an Italian restaurant."},{"spanish":"Trabajo hasta las siete. Despu\xe9s de mi trabajo, estoy muy cansado, pero soy feliz con mi vida.","english":"I work until seven. After my job, I\'m very tired, but I am happy with my life."}]},{"id":2,"title":"La Vida de Mario","sentences":[{"spanish":"Mi amigo se llama Mario. \xc9l es de M\xe9xico y \xe9l vive en mi calle en una casa grande.","english":"My friend is named Mario. He is from Mexico and he lives on my street in a big house."},{"spanish":"\xc9l tiene un perro grande y un gato peque\xf1o. \xc9l est\xe1 feliz porque sus mascotas son divertidas.","english":"He has a big dog and a small cat. He is happy because his pets are fun."},{"spanish":"Mario trabaja en una oficina en el centro de la ciudad. \xc9l es muy ocupado, pero \xe9l es un buen trabajador.","english":"Mario works in an office in the city center. He is very busy, but he is a good worker."},{"spanish":"\xc9l come pizza los s\xe1bados con sus amigos. \xc9l tambi\xe9n va al parque y habla con ellos por las tardes.","english":"He eats pizza on Saturdays with his friends. He also goes to the park and talks with them in the afternoons."},{"spanish":"A Mario le gusta ir a la biblioteca. \xc9l va a la biblioteca con su hermana que es una estudiante.","english":"Mario likes to go to the library. He goes to the library with his sister who is a student."},{"spanish":"Ella es muy inteligente y ella est\xe1 en la clase de espa\xf1ol. \xc9l es una persona muy simp\xe1tica.","english":"She is very intelligent and she is in the Spanish class. He is a very nice person."},{"spanish":"Mario tiene muchos amigos porque siempre ayuda a las personas.","english":"Mario has many friends because he always helps people."}]},{"id":3,"title":"Tu Vida","sentences":[{"spanish":"T\xfa eres una persona ocupada. Vives en una casa peque\xf1a con tu familia y trabajas en una oficina en la ciudad.","english":"You are a busy person. You live in a small house with your family and work in an office in the city."},{"spanish":"T\xfa tienes un perro. \xc9l es un perro grande. Siempre que llegas a casa, \xe9l est\xe1 muy feliz de verte y juega contigo.","english":"You have a dog. He is a big dog. Whenever you get home, he is very happy to see you and plays with you."},{"spanish":"T\xfa comes arroz para el desayuno a veces. Los fines de semana, t\xfa vas al cine con tus amigos. Te gusta mucho ver pel\xedculas de comedia.","english":"You eat rice for breakfast sometimes. On weekends, you go to the movies with your friends. You really like to watch comedy movies."},{"spanish":"T\xfa hablas con tus amigos en el parque. T\xfa eres una persona simp\xe1tica. Tus amigos te aprecian porque t\xfa eres divertido.","english":"You talk with your friends in the park. You are a nice person. Your friends appreciate you because you are fun."},{"spanish":"T\xfa tienes un hermano que vive en la ciudad, pero \xe9l visita a menudo. \xc9l es una persona muy divertida y t\xfa hablas con \xe9l todos los d\xedas.","english":"You have a brother who lives in the city, but he visits often. He is a very fun person and you talk with him every day."},{"spanish":"T\xfa vas al gimnasio en las ma\xf1anas. T\xfa eres muy activo, pero t\xfa est\xe1s cansado al final del d\xeda. No importa, porque t\xfa eres feliz.","english":"You go to the gym in the mornings. You are very active, but you are tired at the end of the day. It doesn\'t matter, because you are happy."}]}],"speaking":{"title":"Conjugaci\xf3n de Verbos","description":"Preguntas y respuestas para practicar la conjugaci\xf3n de verbos esenciales como \'ser\', \'estar\', \'tener\', y \'trabajar\' en el presente.","questions_and_answers":[{"question":{"spanish":"\xbfQu\xe9 comes en el desayuno?","english":"What do you eat for breakfast?"},"answer":{"spanish":"Yo como arroz y huevos.","english":"I eat rice and eggs."}},{"question":{"spanish":"\xbfD\xf3nde trabaja ella?","english":"Where does she work?"},"answer":{"spanish":"Ella trabaja en una oficina.","english":"She works in an office."}},{"question":{"spanish":"\xbfTienes hermanos?","english":"Do you have siblings?"},"answer":{"spanish":"S\xed, yo tengo dos hermanos.","english":"Yes, I have two siblings."}},{"question":{"spanish":"\xbfQu\xe9 vas a hacer hoy?","english":"What are you going to do today?"},"answer":{"spanish":"Yo voy al gimnasio.","english":"I\'m going to the gym."}},{"question":{"spanish":"\xbfC\xf3mo est\xe1s?","english":"How are you?"},"answer":{"spanish":"Yo estoy muy bien, gracias.","english":"I am very well, thank you."}},{"question":{"spanish":"\xbfEres de M\xe9xico?","english":"Are you from Mexico?"},"answer":{"spanish":"S\xed, yo soy de M\xe9xico.","english":"Yes, I am from Mexico."}},{"question":{"spanish":"\xbfD\xf3nde vive tu amigo?","english":"Where does your friend live?"},"answer":{"spanish":"\xc9l vive en un apartamento.","english":"He lives in an apartment."}},{"question":{"spanish":"\xbfElla tiene un perro o un gato?","english":"Does she have a dog or a cat?"},"answer":{"spanish":"Ella tiene un perro grande.","english":"She has a big dog."}},{"question":{"spanish":"\xbfA d\xf3nde va \xe9l?","english":"Where is he going?"},"answer":{"spanish":"\xc9l va a la biblioteca.","english":"He is going to the library."}},{"question":{"spanish":"\xbfQu\xe9 le gusta hacer a ella en su tiempo libre?","english":"What does she like to do in her free time?"},"answer":{"spanish":"Ella habla con sus amigos.","english":"She talks with her friends."}},{"question":{"spanish":"\xbfEst\xe1s cansado?","english":"Are you tired?"},"answer":{"spanish":"S\xed, estoy cansado porque trabajo mucho.","english":"Yes, I am tired because I work a lot."}},{"question":{"spanish":"\xbfD\xf3nde vives?","english":"Where do you live?"},"answer":{"spanish":"Yo vivo en una casa peque\xf1a.","english":"I live in a small house."}},{"question":{"spanish":"\xbfQu\xe9 es tu trabajo?","english":"What is your job?"},"answer":{"spanish":"Yo soy un estudiante.","english":"I am a student."}},{"question":{"spanish":"\xbf\xc9l es feliz?","english":"Is he happy?"},"answer":{"spanish":"S\xed, \xe9l es muy feliz.","english":"Yes, he is very happy."}},{"question":{"spanish":"\xbfHablas espa\xf1ol?","english":"Do you speak Spanish?"},"answer":{"spanish":"S\xed, yo hablo espa\xf1ol y un poco de ingl\xe9s.","english":"Yes, I speak Spanish and a little bit of English."}},{"question":{"spanish":"\xbfTiene usted un carro?","english":"Do you have a car? (formal)"},"answer":{"spanish":"No, yo no tengo un carro.","english":"No, I don\'t have a car."}},{"question":{"spanish":"\xbfCu\xe1ndo vas al trabajo?","english":"When do you go to work?"},"answer":{"spanish":"Yo voy al trabajo por la ma\xf1ana.","english":"I go to work in the morning."}},{"question":{"spanish":"\xbfQu\xe9 come ella en la cena?","english":"What does she eat for dinner?"},"answer":{"spanish":"Ella come pizza.","english":"She eats pizza."}},{"question":{"spanish":"\xbf\xc9l es de la misma ciudad que t\xfa?","english":"Is he from the same city as you?"},"answer":{"spanish":"S\xed, \xe9l es de la misma ciudad.","english":"Yes, he is from the same city."}},{"question":{"spanish":"\xbfEst\xe1s en la casa?","english":"Are you at home?"},"answer":{"spanish":"No, no estoy en la casa, estoy en la oficina.","english":"No, I am not at home, I am at the office."}}]}}}')}}]);